import s from '../../WhyChooseUs.module.css';

const Slide = (props) => {
    return (
        <div id="sliderEl">
            <img className="slide" src={props.image}></img>
            {/* <div id="parag"> */}
            <h2>{props.h2}</h2>
            <p id="slider-p">{props.p2}</p>
            {/* </div> */}
        </div>
    )
}


export default Slide;
